import { useState } from "react";

function ApplyToday() {
  const [form, setForm] = useState({
    firstName: "",
    middleName: "",
    lastName: "",
    suffix: "",
    ssn: "",
    dob: "",
    address1: "",
    address2: "",
    country: "United States",
    city: "",
    state: "",
    zip: "",
    residence3yrs: "",
    primaryPhone: "",
    cellPhone: "",
    email: "",
    confirmEmail: "",
    preferredContact: "Primary Phone",
    bestTime: "Any",
    consent: false,
    license: ""
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setForm({ ...form, [name]: type === "checkbox" ? checked : value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (form.email !== form.confirmEmail) {
      alert("Email addresses do not match");
      return;
    }

    const ownerEmail = "owner@rgmfamily.com"; // CHANGE THIS

    const subject = "New Driver Application - RGM Family";

    const body = `
RGM FAMILY - DRIVER APPLICATION

Personal Information
--------------------
Name: ${form.firstName} ${form.middleName} ${form.lastName} ${form.suffix}
SSN / SIN: ${form.ssn}
DOB: ${form.dob}
License Number: ${form.license}

Address
-------
${form.address1}
${form.address2}
${form.city}, ${form.state}, ${form.zip}
Country: ${form.country}
Residence 3+ years: ${form.residence3yrs}

Contact
-------
Primary Phone: ${form.primaryPhone}
Cell Phone: ${form.cellPhone}
Email: ${form.email}
Preferred Contact: ${form.preferredContact}
Best Time: ${form.bestTime}

Consent to Automated Communication: ${form.consent ? "Yes" : "No"}

Virtual Meeting Request
-----------------------
Applicant requests a virtual meeting with the owner via Google Meet.
Please reply with available time and meeting link.
`;

    window.location.href =
      `mailto:${ownerEmail}?subject=${encodeURIComponent(subject)}&body=${encodeURIComponent(body)}`;
  };

  return (
    <div style={{ padding: "40px", maxWidth: "900px", margin: "auto" }}>
      <h1>Apply Today â€“ Join the RGM Family</h1>

      <p>
        Thank you for your interest in <strong>RGM Family</strong>.
        Please complete the online application below.
        Incomplete information may delay processing.
      </p>

      <form onSubmit={handleSubmit}>
        <h3>Personal Information</h3>

        <input name="firstName" placeholder="First Name *" required onChange={handleChange} />
        <input name="middleName" placeholder="Middle Name" onChange={handleChange} />
        <input name="lastName" placeholder="Last Name *" required onChange={handleChange} />
        <input name="suffix" placeholder="Suffix" onChange={handleChange} />

        <input name="ssn" placeholder="SSN / SIN *" required onChange={handleChange} />
        <input name="dob" type="date" required onChange={handleChange} />
        <input name="license" placeholder="Driver License Number *" required onChange={handleChange} />

        <h3>Address</h3>

        <input name="address1" placeholder="Street Address Line 1 *" required onChange={handleChange} />
        <input name="address2" placeholder="Street Address Line 2" onChange={handleChange} />
        <input name="city" placeholder="City *" required onChange={handleChange} />
        <input name="state" placeholder="State / Province *" required onChange={handleChange} />
        <input name="zip" placeholder="Zip / Postal Code *" required onChange={handleChange} />

        <select name="residence3yrs" required onChange={handleChange}>
          <option value="">Residence 3+ years?</option>
          <option value="Yes">Yes</option>
          <option value="No">No</option>
        </select>

        <h3>Contact</h3>

        <input name="primaryPhone" placeholder="Primary Phone *" required onChange={handleChange} />
        <input name="cellPhone" placeholder="Cell Phone" onChange={handleChange} />
        <input name="email" type="email" placeholder="Email Address *" required onChange={handleChange} />
        <input name="confirmEmail" type="email" placeholder="Confirm Email *" required onChange={handleChange} />

        <label>
          <input type="checkbox" name="consent" onChange={handleChange} /> I consent to receive automated communication
        </label>

        <br /><br />

        <button type="submit" style={{ padding: "12px 25px", background: "red", color: "#fff", border: "none" }}>
          Submit Application & Request Meeting
        </button>
      </form>
    </div>
  );
}

export default ApplyToday;
